INSERT INTO "Modulo" ( "Nombre", "Descripcion", "Justificacion", "Metodologia", "ActividadAprendizaje", "ActividadEvaluacion", "Objetivos", "CreadoEl", "EditadoEl", "Activo", "CreadoPor", "EditadoPor", "Orden") VALUES (N'Actos administrativos de las áreas metropolitanas', N'Actos Administrativos Contratación', N'Se espera que empoderando a los mandatarios y fortaleciendo las entidades territoriales, se reduzcan en buena medida las brechas económicas y sociales entre las regiones y se obtenga mayor autonomía para asignar más responsabilidades a los territorios, cuya meta sea contribuir a reducir la desigualdad en los departamentos y municipios colombianos, brindando mayor capacidad política y administrativa que se traduzca en actos administrativos de las áreas metropolitanas.', N'Manejo de grupo, moderación, ejemplos del cotidiano, estrategias de mediación y diálogo intercultural. Aplicar estrategias de metodología de reflexión, critica constructiva, participación activa y diálogo de saberes.', N'Identificar los tipos de actos administrativos y modalidades de contratos en áreas metropolitanas y de integración territorial', N'1. ¿Considera que en las áreas metropolitanas y de integración territorial se pueden desarrollar contratos plan para la paz?'||CHR(10)
INSERT INTO "Modulo" ( "Nombre", "Descripcion", "Justificacion", "Metodologia", "ActividadAprendizaje", "ActividadEvaluacion", "Objetivos", "CreadoEl", "EditadoEl", "Activo", "CreadoPor", "EditadoPor", "Orden") VALUES (N' El municipio como entidad territorial, creación y delimitación de nuevos municipios', N'Fundamento normativo El municipio como entidad territorial Categorización de municipios Elementos fundamentales para la creación y/o deslinde territorial del municipio', N'Para comprender, analizar y gestionar las políticas y la gestión del municipio es necesario, conocer el fundamento normativo (constitucional y legal), su naturaleza Jurídica, los proceso de administración pública territorial y las competencias asignadas a los municipios', N'El desarrollo del contenido temático se efectuará, mediante conferencia magistral, relatos de experiencias por parte del grupo y análisis del comportamiento normativo', N'Actividad 1:  Presentación magistral y debate para conocer y analizar las normas y gestión pública municipal'||CHR(10)
INSERT INTO "Modulo" ( "Nombre", "Descripcion", "Justificacion", "Metodologia", "ActividadAprendizaje", "ActividadEvaluacion", "Objetivos", "CreadoEl", "EditadoEl", "Activo", "CreadoPor", "EditadoPor", "Orden") VALUES (N' Funciones y competencias del municipio', N'Competencias delegadas del orden nacional y departamental Competencias constitucionales y legales La descentralización y asignación de funciones y competencias', N'Para comprender analizar y gestionar, las políticas y la gestión del municipio es necesario, conocer el fundamento normativo (constitucional y legal), su naturaleza jurídica, los proceso de administración pública territorial y las competencias asignadas a estos.', N'El desarrollo del contenido temático se efectuará, mediante conferencia magistral, relatos de experiencias por parte del grupo y análisis del comportamiento normativo.', N'Actividad 1: Presentación magistral y debate para conocer y analizar las normas y gestión pública municipal.'||CHR(10)
